      title: 'Как работает солнечная электростанция?',
      text: 'Принцип работы современных солнечных электростанций (СЭС) основан на сборе сконцентрированной солнечной энергии при помощи зеркал и отражении солнечных лучей на приемники, которые собирают солнечную энергию и преобразуют его в тепло.\n' + '\n' + 'В солнечной электростанции роль солнечных батарей заключается не в прямом питании электрических потребителей (хотя в определенных ситуациях это вполне оправдано: часы, калькуляторы и подобные приборы), а в обеспечении заряда рабочих аккумуляторов схемы, которые:\n' + '<ul><li>получают электроэнергию от солнечных модулей,\n</li>' + '<li>накапливают ее и передают потребителям.\n</li></ul>'
