      title: 'Как работают солнечные модули зимой?',
      text: 'Солнечные батареи работают при попадании на них солнечного света. В связи с тем, что продолжительность светового дня зимой сокращается и количество пасмурных дней больше, панели уже не могут вырабатывать одинаковое количество энергии и их продуктивность падает. Однако батареи работают не от солнечных лучей, а от солнечного света в принципе. Электромагнитное излучение достигает земли в любое время года. Поэтому зимой могут случаться небольшие промежутки, когда батареи не успевают полностью заряжаться, но за зиму это происходит редко. Идеальная зимняя погода для солнечной батареи – морозный безоблачный день. Иногда в такие дни даже происходят рекорды по генерации.'
